import React, { Component } from 'react';
import '../App.css';
import Header from './Header';
import DragAndDrop from './DragAndDrop';

export default class Work extends Component {

  render() {
    return (
      <div className="App">
          <Header></Header>
          <Router>
                <Route path="/DragAndDrop" component={DragAndDrop}/>
        </Router>
      </div>
    )
  }

}
